import {actionTypes} from "../actions/actionTypes"
import { initialAccount } from "./initialStore"


const accountStore = ( state = initialAccount, action) => {
    switch(action.type){
    case actionTypes.POST_LOGIN_START:
        return{
            ...state,
            accountFetch: true,
            accountError: ""
        }
    default:
        return state
}}

export default accountStore
